cale=1.0\"&gt;\n    &lt;title&gt;Interactive Dashboard&lt;/title&gt;\n    &lt;style&gt;\n        body {\n            font-family: Arial, sans-serif;\n            margin: 20px;\n        }\n        h1 {\n            font-size: 24px;\n            text-align: center;\n        }\n        p {\n            font-size: 12px;\n            line-height: 1.5;\n            text-align: justify;\n        }\n        .paper-citation, .conference-paper {\n            margin: 20px 0;\n            font-size: 10px;\n        }\n        .conference-name {\n            font-style: italic;\n        }\n        .authors, .conference-details {\n            font-style: italic;\n        }\n    &lt;/style&gt;\n&lt;/head&gt;\n&lt;body&gt;\n\n    &lt;h1&gt;Interactive Dashboard Information (04/07/2024)&lt;/h1&gt;\n\n    &lt;div class=\"paper-citation\"&gt;\n        &lt;p&gt;Please refer to the following paper for the charts and the theory behind them:&lt;/p&gt;\n        &lt;p&gt;&lt;strong&gt;Robertson, P. K. (2010, May).&lt;/strong&gt; Soil behavior type from the CPT: an update. In &lt;span class=\"conference-name\"&gt;2nd International Symposium on Cone Penetration Testing&lt;/span&gt; (Vol. 2, No. 56, p. 8). Huntington Beach: Cone Penetration Testing Organizing Committee.&lt;/p&gt;\n    &lt;/div&gt;\n\n    &lt;div class=\"dashboard-info\"&gt;\n        &lt;p&gt;Note that I built the interactive dashboard on this page during my research visit to the Norwegian Geotechnical Institute (NGI) between May and August 2024. The production of individual pages like this one for each CPTu sounding has been automated and utilized in the activity. What you see here has the same layout and interactivity. However, to protect the data ownership of NGI, I have used made-up data to represent real CPTu data.&lt;/p&gt;\n    &lt;/div&gt;\n\n    &lt;div class=\"conference-paper\"&gt;\n        &lt;p&gt;If you are coming from future, please refer to the conference paper we submitted to the ISGSR 2025 for more insights about the overall activity:&lt;/p&gt;\n        &lt;p&gt;&lt;strong&gt;Tabak, E., N\u00f8st, H. A., &amp; R\u00f8dvand, L. (2025, August).&lt;/strong&gt; Use and automation of multi-source data with a GIS approach to map the presence of quick clay. &lt;span class=\"conference-name\"&gt;9th International Symposium on Geotechnical Safety and Risk (ISGSR) 2025&lt;/span&gt;, Oslo, Norway.&lt;/p&gt;\n    &lt;/div&gt;\n\n&lt;/body&gt;\n&lt;/html&gt;\n\n\n\n"}}]}},{"type":"object","name":"Row","id":"p4812","attributes":{"children":[{"type":"object","name":"Figure","id":"p4633","attributes":{"width":300,"height":580,"x_range":{"type":"object","name":"DataRange1d","id":"p4635"},"y_range":{"type":"object","name":"Range1d","id":"p4643","attributes":{"start":9.12,"end":1.21}},"x_scale":{"type":"object","name":"LinearScale","id":"p4644"},"y_scale":{"type":"object","name":"LinearScale","id":"p4645"},"title":{"type":"object","name":"Title","id":"p4636","attributes":{"text":"Soil Type Behavior Index","text_color":"black","text_font":"times","text_font_size":"20px","text_baseline":"middle","background_fill_color":"white","align":"center"}},"renderers":[{"type":"object","name":"GlyphRenderer","id":"p4690","attributes":{"data_source":{"type":"object","name":"ColumnDataSource","id":"p4684","attributes":{"selected":{"type":"object","name":"Selection","id":"p4685","attributes":{"indices":[],"line_indices":[]}},"selection_policy":{"type":"object","name":"UnionRenderers","id":"p4686"},"data":{"type":"map"}}},"view":{"type":"object","name":"CDSView","id":"p4691","attributes":{"filter":{"type":"object","name":"AllIndices","id":"p4692"}}},"glyph":{"type":"object","name":"Rect","id":"p4687","attributes":{"x":{"type":"value","value":0.655},"y":{"type":"value","value":4.56},"width":{"type":"value","value":1.31},"height":{"type":"value","value":9.12},"line_color":{"type":"value","value":"#F79C9C"},"line_alpha":{"type":"value","value":0.75},"fill_color":{"type":"value","value":"#F79C9C"},"fill_alpha":
